#define f (1UL << 16UL)

// Multiplication, addition, subtraction, and division
// fixed-point arithmetic for 64 bit unsigned values.
uint64_t convert_double_to_fp(double n);
uint64_t convert_uint64_t_to_fp(uint64_t n);
uint64_t convert_fp_to_uint64_t_rz(uint64_t x);
uint64_t convert_fp_to_uint64_t_rn(uint64_t x);
uint64_t add_fp(uint64_t x, uint64_t y);
uint64_t sub_fp(uint64_t x, uint64_t y);
uint64_t add_fp_uint64_t(uint64_t x, uint64_t n);
uint64_t sub_fp_uint64_t(uint64_t x, uint64_t n);
uint64_t mult_fp(uint64_t x, uint64_t y);
uint64_t mult_fp_uint64_t(uint64_t x, uint64_t n);
uint64_t mult_fp(uint64_t x, uint64_t y);
uint64_t div_fp(uint64_t x, uint64_t y);
uint64_t div_fp_uint64_t(uint64_t x, uint64_t n);

uint64_t 
convert_double_to_fp(double n)
{
    return (uint64_t) (n * f);
}

uint64_t 
convert_uint64_t_to_fp(uint64_t n)
{
    return n * f;
}

// convert fixed pouint64_t to uint64_teger and round to zero
uint64_t 
convert_fp_to_uint64_t_rz(uint64_t x)
{
    return (x < 0) ? ((x - (f / 2)) / f) : ((x + (f / 2)) / f);
}

// convert fixed pouint64_t to uint64_terger and round to nearest
uint64_t 
convert_fp_to_uint64_t_rn(uint64_t x)
{
    return x / f;
}

uint64_t 
add_fp(uint64_t x, uint64_t y)
{
    return x + y;
}

uint64_t 
sub_fp(uint64_t x, uint64_t y)
{
    return x - y;
}

uint64_t 
add_fp_uint64_t(uint64_t x, uint64_t n)
{
    return x + convert_uint64_t_to_fp(n);
}

uint64_t 
sub_fp_uint64_t(uint64_t x, uint64_t n)
{
    return x - convert_uint64_t_to_fp(n);
}

uint64_t 
mult_fp(uint64_t x, uint64_t y)
{
    return (((uint64_t) x) * y / f);
}

uint64_t 
mult_fp_uint64_t(uint64_t x, uint64_t n)
{
    return x * n;
}

uint64_t 
div_fp(uint64_t x, uint64_t y)
{
    return (((uint64_t) x) * f / y);
}

uint64_t 
div_fp_uint64_t(uint64_t x, uint64_t n)
{
    return x / n;
}

